import React from "react";
import {
  Routes,
  Route,
  useRoutes,
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import HomePage from "./pages/HomePage";
import NewsPage from "./pages/NewsPage";
import NewsPageDetail from "./pages/NewsPageDetail";
import NotFoundPage from "./pages/NotFoundPage";
import GalleryPage from "./pages/GalleryPage";
import GalleryPageDetail from "./pages/GalleryPageDetail";
import ContactsPage from "./pages/ContacsPage";

export const RoutesList = [
  { path: "/", element: <HomePage />, breadcrumb: "Главная" },
  { path: "/news", element: <NewsPage />, breadcrumb: "Новости" },
  { path: "/news/:slug", element: <NewsPageDetail />, breadcrumb: "Главная" },
  { path: "/gallery", element: <GalleryPage />, breadcrumb: "Галерея" },
  {
    path: "/gallery/:slug",
    element: <GalleryPageDetail />,
    breadcrumb: "Главная",
  },
  { path: "/contacts", element: <ContactsPage />, breadcrumb: "Контакты" },
  { path: "/*", element: <NotFoundPage />, breadcrumb: "404" },
];
const router = createBrowserRouter(RoutesList);
function App() {
  return (
    <>
      <Header />
      <RouterProvider router={router} />
      <Footer />
    </>
  );
}

export default App;
